description:
18 эффектов:

серебряные сферы с красными звездами;
зелено - пурпурные мерцающие пионы;
золотые ивы с разноцветными звездами;
зеленые звезды с золотым мерцанием;
золотые змейки;
шумовой удар;
шуршащие зеленые цветы;
красные хризантемы с треском;
золотой треск с красными жемчужинами;
золотой треск с синими жемчужинами;
трещащие шлейфы;
пурпурные пионы с треском;
мерцающие красные ивы с синими звездами;
мерцающие зеленые ивы с пурпурными ветвями;
шуршащие пальмы с синими жемчужинами;
золотые пальмы в зеленых звездах;
золотая парча с разноцветными звездами;
финал - трещащие пальмы.

8 эффектов:

серебряные рыбки и желтые листья;
синие пионы с рыбками;
золотые конские хвосты;
золотая парча с яркими звездами;
красные и зеленые шлейфы;
разноцветные хризантемы;
трещащие цветы;
финал - золотой треск с синими жемчужинами.

Эффекты:

золотые шуршащие пальмы;
мерцающие облака с пурпурными жемчужинами;
золотой треск с красными звездами;
шуршащие пальмы в зеленом блеске;
финал - золотое трещащее облако.

5 эффектов. Трещащие искристые трассы разрываются сферами из:&nbsp;

крупных красных огней и трещащих искристых форсов;
крупных зеленых огней и трещащих искристых форсов;
крупных желтых огней и трещащих искристых форсов;
синих огней и трещащих искристых форсов;
крупных фиолетовых огней и трещащих искристых форсов.

Красочная концовка из нескольких залпов.
